import React, { Fragment } from 'react';
import Card_List from './Card_List';
import {robots} from './robots'
 const App = () =>{
     return (
         <Fragment>
         <h1 className="tc">Robofriends</h1>
         <Card_List robots={robots} />
         </Fragment>
     )
 }
 export default App;
